import { useEffect } from "react";
import { useState } from "react";
import logo from ".././bg-mobile-dark.jpg";
import "./countryCard.css";
function CountryCards({ query }) {
  const [country, setCountry] = useState([]);
  const searchCountry = fetch(
    `https://restcountries.com/v3.1/name/${"africa"}`
  );

  async () => {
    const response = await fetch(
      `https://restcountries.com/v3.1/name/${"africa"}`
    ).then((resp) => {
      if (!resp.ok) throw new Error(`Response not responding ${resp.status}`);
      console.log(resp);
      return resp.json();
    }).then((datas) => {

    })
    
  };
  useEffect(() => {
    searchCountry();
  }, []);
  return (
    <>
      <div className="card-container">
        <div className="card">
          <div>
            <img className="image" alt="flag" src={logo} />
          </div>
          <div className="card-text">
            <h2>{country}</h2>
            <div className="flexit">
              <p>Population:</p>
              <span>400,000</span>
            </div>
            <div className="flexit">
              <p>Region:</p>
              <span>Europe</span>
            </div>
            <div className="flexit">
              <p>Europe:</p>
              <span>Berlin</span>
            </div>
          </div>
        </div>
        <div className="card">
          <div>
            <img className="image" alt="flag" src={logo} />
          </div>
          <div className="card-text">
            <h2>Germany</h2>
            <div className="flexit">
              <p>Population:</p>
              <span>400,000</span>
            </div>
            <div className="flexit">
              <p>Region:</p>
              <span>Europe</span>
            </div>
            <div className="flexit">
              <p>Europe:</p>
              <span>Berlin</span>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default CountryCards;
